import React, { useState, useRef } from "react";
import { useNavigate } from "react-router-dom";
import "./SLogin.css";

export default function SLogin() {
  const navigate = useNavigate();
  const fileRef = useRef(null);

  const [isLogin, setIsLogin] = useState(true);
  const [showPassword, setShowPassword] = useState(false);
  const [imagePreview, setImagePreview] = useState(null);

  const [loginData, setLoginData] = useState({ email: "", password: "" });
  const [signupData, setSignupData] = useState({
    fullName: "",
    rollNo: "",
    semester: "",
    email: "",
    password: "",
    photo: null,
  });

  const handleLoginChange = (e) =>
    setLoginData({ ...loginData, [e.target.name]: e.target.value });

  const handleSignupChange = (e) =>
    setSignupData({ ...signupData, [e.target.name]: e.target.value });

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setSignupData({ ...signupData, photo: file });

    if (file) {
      const reader = new FileReader();
      reader.onload = () => setImagePreview(reader.result);
      reader.readAsDataURL(file);
    }
  };

  return (
    <div className="auth-wrapper">
      <div className="auth-card">

        <h2 className="auth-title">Student Portal</h2>
        <p className="auth-subtitle">
          {isLogin ? "Login to your account" : "Create a new account"}
        </p>

        {/* Toggle */}
        <div className="auth-tabs">
          <button className={isLogin ? "active" : ""} onClick={() => setIsLogin(true)}>
            Login
          </button>
          <button className={!isLogin ? "active" : ""} onClick={() => setIsLogin(false)}>
            Sign Up
          </button>
        </div>

        {/* LOGIN */}
        {isLogin ? (
          <div className="auth-form">
            <input
              type="email"
              name="email"
              placeholder="Email"
              onChange={handleLoginChange}
            />

            <div className="password-box">
              <input
                type={showPassword ? "text" : "password"}
                name="password"
                placeholder="Password"
                onChange={handleLoginChange}
              />
              <span onClick={() => setShowPassword(!showPassword)}>
                {showPassword ? "üôà" : "üëÅÔ∏è"}
              </span>
            </div>

            <button className="primary-btn" onClick={handleLogin}>
              Login
            </button>
          </div>
        ) : (
          /* SIGNUP */
          <div className="auth-form">
            <input name="fullName" placeholder="Full Name" onChange={handleSignupChange} />
            <input name="rollNo" placeholder="Roll No" onChange={handleSignupChange} />
            <input name="semester" placeholder="Semester" onChange={handleSignupChange} />
            <input type="email" name="email" placeholder="Email" onChange={handleSignupChange} />

            <div className="password-box">
              <input
                type={showPassword ? "text" : "password"}
                name="password"
                placeholder="Password"
                onChange={handleSignupChange}
              />
              <span onClick={() => setShowPassword(!showPassword)}>
                {showPassword ? "üôà" : "üëÅÔ∏è"}
              </span>
            </div>

            {/* Upload */}
            <div className="upload-box" onClick={() => fileRef.current.click()}>
              {imagePreview ? (
                <img src={imagePreview} alt="preview" />
              ) : (
                <p>Click to upload photo</p>
              )}
            </div>

            <input
              type="file"
              accept="image/*"
              ref={fileRef}
              hidden
              onChange={handleFileChange}
            />

            <button className="primary-btn" onClick={handleSignup}>
              Create Account
            </button>
          </div>
        )}
      </div>
    </div>
  );
}
